" <div id=\"topicContent\">",
"  <div id=\"topicTitle\">",
"   Epidemiology, pathogenesis, and clinical manifestations of Ebola and Marburg hemorrhagic fever",
"  </div>",
"  <div id=\"topicContributors\">",
"   <div>",
"    <a id=\"authors\">",
"    </a>",
