var title_f19_16_19722="Small vessel vasculitis Churg Strauss";
var content_f19_16_19722=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=RHEUM%2F57180%7EPULM%2F82366&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=RHEUM%2F57180%7EPULM%2F82366&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Histopathology of eosinophilic granulomatosis with polyangiitis (Churg-Strauss)",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 360px; height: 235px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Small artery in a patient with&nbsp;eosinophilic granulomatosis with polyangiitis (Churg-Strauss) showing intimal fibrinoid necrosis and mural infiltration by histiocytes consistent with a necrotizing granulomatous vasculitis. There is marked extravascular eosinophilia.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Eosinophilic granulomatosis with polyangiitis (Churg-Strauss)",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 354px; height: 245px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Low power view of a lung biopsy from a patient with eosinophilic granulomatosis with polyangiitis (Churg-Strauss) showing well-established, necrotizing and occlusing arterial lesions with obliteration of the arterial lumen. Dilatation of lymphatic channels in the arterial adventitia contributes significantly to the marked size discrepancy between the artery and its adjacent bronchiole. Other regions of the lung reveal marked intraalveolar eosinophilic infiltration in the parenchyma (Hematoxylin and eosin, x 10).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Talmadge E King, Jr, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
